query pages_CommandersQuery(
  $timePeriod: TimePeriod!
  $sortBy: CommandersSortBy!
  $minEntries: Int
  $minTournamentSize: Int!
  $colorId: String
) {
  ...pages_topCommanders
}

fragment pages_TopCommandersCard on Commander {
  name
  colorId
  breakdownUrl
  stats(filters: {timePeriod: $timePeriod, minSize: $minTournamentSize}) {
    conversionRate
    topCuts
    count
    metaShare
    topCutBias
  }
  cards {
    imageUrls
    id
  }
}

fragment pages_topCommanders on Query {
  commanders(first: 48, timePeriod: $timePeriod, sortBy: $sortBy, colorId: $colorId, minEntries: $minEntries, minTournamentSize: $minTournamentSize) {
    edges {
      node {
        id
        ...pages_TopCommandersCard
        __typename
      }
      cursor
    }
    pageInfo {
      endCursor
      hasNextPage
    }
  }
}

