query Commander_CommanderQuery(
  $commander: String!
  $sortBy: EntriesSortBy!
  $minEventSize: Int
  $maxStanding: Int
  $timePeriod: TimePeriod!
) {
  commander(name: $commander) {
    ...Commander_CommanderPageShell
    ...Commander_entries
    id
  }
}

fragment Commander_CommanderBanner on Commander {
  name
  colorId
  cards {
    imageUrls
    id
  }
  stats(filters: {timePeriod: $timePeriod, minSize: $minEventSize}) {
    conversionRate
    metaShare
    count
    topCuts
    topCutBias
  }
}

fragment Commander_CommanderMeta on Commander {
  name
}

fragment Commander_CommanderPageShell on Commander {
  name
  breakdownUrl
  ...Commander_CommanderBanner
  ...Commander_CommanderMeta
  promo {
    ...promo_EmbededPromo
  }
}

fragment Commander_EntryCard on Entry {
  standing
  wins
  losses
  draws
  decklist
  player {
    name
    isKnownCheater
    id
  }
  tournament {
    name
    size
    tournamentDate
    TID
    id
  }
}

fragment Commander_entries on Commander {
  entries(first: 48, sortBy: $sortBy, filters: {minEventSize: $minEventSize, maxStanding: $maxStanding, timePeriod: $timePeriod}) {
    edges {
      node {
        id
        ...Commander_EntryCard
        __typename
      }
      cursor
    }
    pageInfo {
      endCursor
      hasNextPage
    }
  }
  id
}

fragment promo_EmbededPromo on FirstPartyPromo {
  title
  description
  buttonText
  backgroundImageUrl
  imageUrl
  href
}
